import React from 'react';
import Link from 'next/link';

class Index extends React.Component {
    // constructor
    constructor(props) {
        super(props);
    }

    // render display
    render () {
        return (
            <div className="container">
                <div className="navbar">
                    <Link href="/search">
                        <a>SEARCH</a>
                    </Link>
                    <Link href="/about">
                        <a>ABOUT</a>
                    </Link>
                    <Link href="/">
                        <a>HOME</a>
                    </Link>
                </div>
                <div className="content">
                    <h1>CAMPA'ROUND</h1>
                </div>

            <style jsx>{`
                .container {
                    font-family: Roboto;
                    margin: 0;
                }

                .navbar {
                    float: right;
                    padding: 10px 30px 0 0;
                    width: 100%;
                    margin-bottom: 200px;
                }

                a {
                    float: right;
                    padding-left: 36px;
                    text-decoration: none;
                    color: black;
                }

                .content {
                    text-align: center;
                    letter-spacing: 1.6em;
                }

                h1 {
                    font-size: 1.3em;
                }
            `}</style>
            </div>
        );
    }
}

export default Index;
